import React from "react";
import "./ActionModal.css";
import { FaCheckCircle } from "react-icons/fa";
import logo from "../assets/logo/logo.png";

const ActionModal = ({ onClose }) => {
  return (
    <div className="modal-overlay">
      <div className="modal-content animate-modal">
        {/* Close Button */}
        <button className="modal-close" onClick={onClose}>
          &times;
        </button>

        {/* Logo */}
        <div className="modal-logo">
          <img src={logo} alt="Franexpo Logo" />
        </div>

        {/* Title */}
        <h2 className="modal-title">Choose Your Interest</h2>
        <p className="modal-subtitle">
          Take the next step towards growing your business at{" "}
          <strong>Franexpo 2025</strong>
        </p>

        {/* Option Buttons */}
        <div className="modal-buttons">
          <button className="modal-btn primary-btn">Stall Booking</button>
          <button className="modal-btn primary-btn">Sponsor Registration</button>
          <button className="modal-btn primary-btn">Investor Registration</button>
        </div>

        {/* Divider */}
        <div className="modal-divider"></div>

        {/* Why Attend Section */}
        <div className="modal-benefits">
          <h3>Why Attend Franexpo?</h3>
          <ul>
            <li>
              <FaCheckCircle /> Meet <strong>100+ leading brands</strong>
            </li>
            <li>
              <FaCheckCircle /> Network with <strong>700+ visitors</strong>
            </li>
            <li>
              <FaCheckCircle /> Explore <strong>franchise & investment</strong>{" "}
              opportunities
            </li>
            <li>
              <FaCheckCircle /> Hosted at{" "}
              <strong>Taj Skyline, Ahmedabad</strong>
            </li>
          </ul>
        </div>

        {/* Footer */}
        <div className="modal-footer">
          Already registered?{" "}
          <a href="#login" className="modal-link">
            Login here
          </a>
        </div>
      </div>
    </div>
  );
};

export default ActionModal;
